import React from "react";
import Buttons from "./Buttons";
function Card({ id, imageSrc }) {
  console.log(id);
  return (
    <div className="card">
      <img className="image" src={imageSrc} alt="blaa" />
      <h2>Hello</h2>
      <p>Bla</p>
      <Buttons id={id} />
    </div>
  );
}

export default Card;
